import React, { Component } from 'react';
import { CreateButton } from '../../Shared/CreateButton';
import { Award } from './Award';
import { Link } from 'react-router-dom';
import { AUTH_MODEL } from '../../Shared/Auth/Auth';
import jsPDF from 'jspdf';
import _ from 'lodash';

export class Awards extends Component {
    displayName = Awards.name

    constructor(props) {
        super(props);
        this.state = {users: [], awards: [], loading: true };

        this.handleDelete = this.handleDelete.bind(this);
        this.handleEdit = this.handleEdit.bind(this);
        this.onPrint = this.onPrint.bind(this);
    }

    async componentDidMount() {
        try {

            const { token } = AUTH_MODEL.get();
            const response = await fetch('api/awards/nominated', { headers: { authorization: `Bearer ${token}` } });

            const data = await response.json();
            this.setState({ awards: data, loading: false });
        }
        catch (err) {
            console.log("ERR: ", err);
        }
    }


    async onPrint(award) {
        // Use http://dataurl.net/#dataurlmaker

        var img = 'data:image/png;base64,';
        var pdf = new jsPDF('landscape');
        pdf.addImage(img, 'jpeg', 0, 0, 295, 210);
        pdf.text('Sender: ' + award.sfn + ' ' + award.sln, 30, 140);
        pdf.text('Recipient: ' + award.rfn + ' ' + award.rln, 30, 150);
        pdf.text('Time: ' + award.time, 30, 160);
        pdf.text('Date: ' + award.date, 30, 170);
        // Convert the array to a base 64 sring.
        
        //pdf.addImage(award.signature, 'png', 220, 140, 280, 170)
        pdf.setFontStyle("italic");
        pdf.setFontSize(40);
        pdf.text(award.type + ' Award', 90, 60);
        //pdf.save('award.pdf');
        pdf.text(award.type + ' Award', 90, 60);
        //pdf.save('award.pdf');

        let data = {};
        data.pdfContent = pdf.output('datauristring');
        console.log("The base 64 string:\n   {0}\n", data.pdfContent, award.email);
        try {

            const response = await fetch('api/email/sendpdf', {
                method: 'POST',
                body: JSON.stringify(data),
                headers: {
                    'Content-Type': 'application/json'
                }
            })
            console.log("response is: ", response);
        }
        catch (err) {
            console.log("ERR: ", err);
        }
    }

    async handleDelete(id) {

        const { token } = AUTH_MODEL.get();
        let url = `api/awards/delete?id=${id}`;

        const response = await fetch(url, {
            method: 'DELETE',
            headers: { authorization: `Bearer ${token}` }
        });

        if (response.ok)
            this.setState({ awards: _.filter(this.state.awards, (award) => award.id !== id) })
    }

    async handleEdit(award) {
        this.props.history.push({
            pathname: '/Editaward',
            state: { award }
        })
    }

    static renderNominated(awards, handleDelete, handleEdit, onPrint) {
        return (
            <div>
            <Link to='/Addaward'><CreateButton /></Link>
            <br /> <br />
            <div className="form-border">
            <table className='table'>
                <thead>
                    <tr>
                        <th>Sender Name</th>
                        <th>Recipient Name</th>
                        <th>Type</th>
                        <th>Time</th>
                        <th>Date</th>
                    </tr>
                </thead>
                <tbody>
                            {awards.map(award => (
                            <Award
                                key={award.id}
                                handleDelete={handleDelete}
                                handleEdit={handleEdit}
                                onPrint={onPrint}
                                awardInfo={award}
                            />
                        ))}
                </tbody>
            </table>
            </div>
            </div>
        );
    }

   render() {
        let contents = this.state.loading
            ? <p><em>Loading...</em></p>
            : Awards.renderNominated(this.state.awards, this.handleDelete, this.handleEdit, this.onPrint);
    
        return (
            <div>
                <h1>Award infomation</h1>
                {contents}
            </div>
        );
    }
}
